(5733, 40, '_au_subtitle', 'field_61dd23faddf3f'),
(5734, 40, 'au_description', 'G10 is developed by a team of experts that specialize in AI and Algorithm, it has been in development for over 10 years and has finally launched. G10 is hosted on AWS, but we also have a backup server in our company incase AWS goes down. All of your information are End-To-End Encrypted via our AlwaysHidden Technology.\r\n<h6>Our App</h6>\r\nG10 aims to provide everyday people with the power to trade like those in Wall Street, without having the need to hire a personal investor.\r\n<h6><strong>Our Mission</strong></h6>\r\nHere at G10, we want you to trade restriction free, lag free and most importantly hassle free.'),
