(5745, 40, '_ap_subtitle', 'field_61dd287fc84c8'),
(5746, 40, 'ap_description', 'All of our Full-Stack Developer have at least 5 Years of experience in Python and have all worked in major companies such as Apple, Google, Huawei, Etc.\r\n\r\nWe work around the clock to give you the best experience possible, we are always on the lookout for any new trend, technology or even loopholes, so that we can better service you. No challenge is too big for us and too technology is too complicated. If you believe you have what it takes to be part of G10, drop us a message and you must just be the next developer in G10!'),
