(9124, 46, 'privacy_policy_details', '<h6>Overview</h6>\r\nWe may collect personal identification information from Users in a variety of ways, including, but not limited to, when Users visit our site, subscribe to the newsletter, fill out a form, and in connection with other activities, services, features or resources we make<a href=\"http://localhost/fang-git/privacy-policy-2/#\">available</a>on our Site. Users may be asked for, as appropriate, name, email address, mailing address, phone number, company name. We will collect personal<strong>identification</strong>information from Users only if they voluntarily consent such information to us. Users can always refuse to supply personally identification information, except that it may prevent them from engaging in certain Site related activities.\r\n<h5>General permission to use and access and use limitations</h5>\r\nThis site is provided by<strong>G10</strong>.<strong>G10</strong>collects information in several ways from different parts of this site.\r\n\r\n<strong>1.</strong>Complimentary ground shipping within 1 to 7 business days\r\n<strong>2.</strong>In-store collection available within 1 to 7 business days\r\n<strong>3.</strong>Next-day and Express delivery options also available\r\n<strong>4.</strong>Purchases are delivered in an orange box tied with a Bolduc ribbon, with the exception of certain items\r\n<strong>5.</strong>See the delivery FAQs for details on shipping methods, costs and delivery times\r\n<h4>Confidential information</h4>\r\n<strong>G10</strong>accepts the following payment methods:\r\n<ul>\r\n 	<li>Credit Card:<strong>Visa</strong>,<strong>MasterCard</strong>,<strong>Discover</strong>,<strong>American Express</strong>,<strong>JCB</strong>,<strong>Visa Electron</strong>. The total will be charged to your card when the order is shipped.</li>\r\n 	<li><strong>G10</strong>features a Fast Checkout option, allowing you to securely save your credit card details so that you don\'t have to re-enter them for future purchases.</li>\r\n 	<li>PayPal: Shop easily online without having to enter your credit card details on the website.Your account will be charged once the order is completed. To register for a PayPal account, visit the website<a href=\"http://localhost/fang-git/privacy-policy-2/#\" target=\"_blank\" rel=\"noopener\">paypal.com.</a></li>\r\n</ul>\r\n<h3>Linking to this Site</h3>\r\nItems returned within 14 days of their original shipment date in same as new condition will be eligible for a full refund or store credit. Refunds will be charged back form of payment used for purchase. Customer is responsible for shipping charges when making returns and shipping/handling fees of original purchase is non-refundable.\r\n<h2>Intellectual property</h2>\r\nLorem ipsum dolor sit amet, consectetur adipiscing elit. Etiam eget euismod erat, sit amet vulputate enim. Etiam enim tellus, maximus vel augue sed, pharetra hendrerit orci. Vivamus sed massa in nibh imperdiet mattis quis sed augue. Pellentesque erat metus, vestibulum nec nisl.\r\n\r\nLorem ipsum dolor sit amet, consectetur adipiscing elit. Etiam eget euismod erat, sit amet vulputate enim. Etiam enim tellus.\r\n<h1>Security and storage</h1>\r\nLorem ipsum dolor sit amet, consectetur adipiscing elit. Etiam eget euismod erat, sit amet vulputate enim. Etiam enim tellus.\r\n<ol>\r\n 	<li>Credit Card:<strong>Visa</strong>,<strong>MasterCard</strong>,<strong>Discover</strong>,<strong>American Express</strong>,<strong>JCB</strong>,<strong>Visa Electron</strong>. The total will be charged to your card when the order is shipped.</li>\r\n 	<li><strong>G10</strong>features a Fast Checkout option, allowing you to securely save your credit card details so that you don\'t have to re-enter them for future purchases.</li>\r\n 	<li>PayPal: Shop easily online without having to enter your credit card details on the website.Your account will be charged once the order is completed. To register for a PayPal account, visit the website<