(18923, 414, '_faq_accordion_0_acc_title', 'field_61dd5f15d6645'),
(18924, 414, 'faq_accordion_0_acc_description', '<strong>G10</strong>is always looking for talented You can contact our support team from the app or website anytime. We\'re available to help you by phone or email 24 hours a day, 7 days a week. Please note that were unable to service customers at our office locations and we dont have an inbound number for phone support (we\'ll call you!). Learn more about phone support.'),
(18925, 414, '_faq_accordion_0_acc_description', 'field_61dd5f34d6646'),
(18926, 414, 'faq_accordion_1_acc_title', 'Where can I learn more about investing?'),
(18927, 414, '_faq_accordion_1_acc_title', 'field_61dd5f15d6645'),
(18928, 414, 'faq_accordion_1_acc_description', 'Education is essential to financial empowerment. G10 offers digestible articles on the basics of investing, investing lingo, and market trends. We also offers 1-on-1 consultations to Veteran Tier Customers.'),
(18929, 414, '_faq_accordion_1_acc_description', 'field_61dd5f34d6646'),
(18930, 414, 'faq_accordion_2_acc_title', 'When will G10 be available outside of SG?'),
(18931, 414, '_faq_accordion_2_acc_title', 'field_61dd5f15d6645'),
(18932, 414, 'faq_accordion_2_acc_description', 'We dont have plans to launch outside the Singapore as of Q1 2022.Although our global expansion plans are on hold for now, we remain committed to democratizing finance for more people around the world.'),
(18933, 414, '_faq_accordion_2_acc_description', 'field_61dd5f34d6646'),
(18934, 414, 'faq_accordion_3_acc_title', 'What is a Trading Halt?'),
(18935, 414, '_faq_accordion_3_acc_title', 'field_61dd5f15d6645'),
(18936, 414, 'faq_accordion_3_acc_description', 'A trading halt is like a timeout for trading. During a halt, investors cant buy or sell affected stocks or options temporarily, giving everybody a chance to catch their breath from erratic market movements. Halts are issued by stock exchanges like the NYSE and the Nasdaq, not by G10.'),
(18937, 414, '_faq_accordion_3_acc_description', 'field_61dd5f34d6646'),
(18938, 414, 'faq_accordion_4_acc_title', 'How long does stock transfer take?'),
(18939, 414, '_faq_accordion_4_acc_title', 'field_61dd5f15d6645'),
(18940, 414, 'faq_accordion_4_acc_description', 'Stock transfer usually takes 5-7 business days to complete. However, delays may occur if your outgoing account type differs from your G10 account. Delays can also occur if you have any activity in your outgoing account (unsettled stocks, ACH transactions, etc). Please contact us if your transfer is pending for more than 7 business days.'),
(18941, 414, '_faq_accordion_4_acc_description', 'field_61dd5f34d6646'),
(18942, 414, 'faq_accordion_5_acc_title', 'What is buying power?'),
(18943, 414, '_faq_accordion_5_acc_title', 'field_61dd5f15d6645'),
(18944, 414, 'faq_accordion_5_acc_description', 'Buying power is the money an investor has available to buy securities and equals the total cash held in the brokerage account plus all available margin. For margin accounts, there are two kinds of buying power, namely: Overnight Buying Power (ONBP) and Day-Trade Buying Power (DTBP).'),
