(19140, 417, 'faq_accordion_5_acc_title', 'What is buying power?'),
(19141, 417, '_faq_accordion_5_acc_title', 'field_61dd5f15d6645'),
(19142, 417, 'faq_accordion_5_acc_description', 'Buying power is the money an investor has available to buy securities and equals the total cash held in the brokerage account plus all available margin. For margin accounts, there are two kinds of buying power, namely: Overnight Buying Power (ONBP) and Day-Trade Buying Power (DTBP).'),
(19143, 417, '_faq_accordion_5_acc_description', 'field_61dd5f34d6646'),
